System.register([],function(t){return{execute:function(){t({_template_label_introduction:"Giới thiệu",_template_description_introduction:"Giới thiệu là biểu mẫu có bố cục chia theo mô-đun được thiết kế để hiển thị hình ảnh và các tiêu đề nổi bật.",_template_label_timeline:"Dòng thời gian",_template_description_timeline:"Dòng thời gian là biểu mẫu được thiết kế để hiển thị hình ảnh và nội dung của bạn theo thứ tự thời gian.",_template_label_general:"Chung",_template_description_general:"Chung là biểu mẫu cuộn dài để chia sẻ câu chuyện phía sau nội dung của bạn.",_template_label_snapshot:"Ảnh chụp nhanh",_template_description_snapshot:"Ảnh chụp nhanh là biểu mẫu được thiết kế để hiển thị những hình ảnh tuyệt vời của bạn bằng cách sử dụng phân chia, điều hướng chế độ xem và thẻ.",_template_label_blankscrollable:"Cuộn trống",_template_description_blankscrollable:"Một biểu mẫu trống để tạo thiết kế của bạn trong trang cuộn.",_template_label_dash:"Gạch dưới",_template_description_dash:"Dash là một biểu mẫu được thiết kế để hiển thị các số liệu chính bằng cách sử dụng biểu đồ, bản đồ, thẻ và tiện ích văn bản.",_template_label_parallax:"Thị sai",_template_description_parallax:"Thị sai cho phép bạn thêm bố cục hình ảnh anh hùng trong trải nghiệm của mình.",_template_label_epic:"Epic",_template_description_epic:"Epic cung cấp một biểu mẫu cuộn dài được thiết kế để xây dựng trải nghiệm trang web.",_template_label_reveal:"Tiết lộ",_template_description_reveal:"Reveal cho phép bạn tạo một tour tường thuật làm nổi bật các điểm dữ liệu quan trọng bằng cách sử dụng bảng, biểu đồ và đánh dấu phạm vi.",_template_label_gallery:"Bộ sưu tập",_template_description_gallery:"Thư viện là biểu mẫu được thiết kế có hình ảnh thu nhỏ được đặt nổi bật để làm nổi bật nội dung phong phú của bạn.",_template_label_summary:"Thông tin tóm tắt",_template_description_summary:"Tóm tắt là biểu mẫu được tạo ra để sử dụng làm trang phụ hoặc trang kết thúc với nội dung tập trung vào các văn bản mô tả ngắn và liên kết động tới nội dung bổ sung.",_template_label_foldable:"Có thể gập lại",_template_description_foldable:"Có thể gập lại là một biểu mẫu có giao diện mở đơn giản, tập trung vào bản đồ, có một tiêu đề và một trình điều khiển tiện ích.",_template_label_launchpad:"Launchpad",_template_description_launchpad:"Launchpad là một biểu mẫu được thiết kế với trọng tâm đặt vào bản đồ và trình điều khiển tiện ích được cố định ở phía dưới cùng của trang.",_template_label_dart:"Dart",_template_description_dart:"Dart là một biểu mẫu tập trung vào bản đồ, các tiện ích được đặt bên trong một bảng điều khiển cố định ở dưới cùng của bản đồ.",_template_label_jewelrybox:"JewelryBox",_template_description_jewelrybox:"JewelryBox là một biểu mẫu được tạo để hiển thị các đối tượng trong một danh sách kết hợp với một bản đồ.",_template_label_blankfullscreen:"Toàn màn hình trống",_template_description_blankfullscreen:"Một biểu mẫu trống để tạo thiết kế của riêng bạn trong ứng dụng toàn màn hình.",_template_label_quicknavigation:"Điều hướng nhanh",_template_description_quicknavigation:"Điều hướng nhanh cho phép bạn nhanh chóng chuyển đổi giữa nhiều chế độ xem và các đánh dấu phạm vi trên một trang.",_template_label_pocket:"Pocket",_template_description_pocket:"Pocket là biểu mẫu có bản đồ và tiện ích trình giữ chỗ bán trong suốt. Biểu mẫu này phù hợp để tạo các ứng dụng có một tiện ích chính tương tác với bản đồ.",_template_label_journey:"Hành trình",_template_description_journey:"Journey là biểu mẫu được tạo ra bằng cách sử dụng tiện ích đánh dấu phạm vi và bản đồ để cung cấp một trải nghiệm hành trình tương tác.",_template_label_ribbon:"Ribbon",_template_description_ribbon:"Ribbon là biểu mẫu được thiết kế nhấn mạnh vào đánh dấu phạm vi để kiểm soát điều hướng bản đồ.",_template_label_billboard:"Billboard",_template_description_billboard:"Billboard đã được tạo với sự đơn giản; nó chứa một bản đồ và một tiện ích điều khiển.",_template_label_monitor:"Giám sát",_template_description_monitor:"Monitor là một biểu mẫu một trang bao gồm sự kết hợp của các tiện ích được xây dựng để tổ chức, theo dõi và hiển thị trực quan hóa dữ liệu của bạn bằng cách sử dụng bố cục bảng điều khiển.",_template_label_header1:"Đầu mục 1",_template_label_header2:"Đầu mục 2",_template_label_header3:"Đầu mục 3",_template_label_header4:"Đầu mục 4",_template_label_footer1:"Chân trang 1",_template_label_footer2:"Chân trang 2",_template_label_footer3:"Chân trang 3",_template_label_footer4:"Chân trang 4",_template_label_scenic:"Ngắm cảnh",_template_description_scenic:"Scenic cho phép bạn tạo một hành trình tường thuật sử dụng tiện ích đánh dấu phạm vi trong một bố cục nhiều trang.",_template_label_exhibition:"Cuộc triển lãm",_template_description_exhibition:"Triển lãm cung cấp một bố cục nhiều trang nhằm xây dựng một trang web làm nổi bật hình ảnh và nội dung của bạn bằng thẻ bài, danh sách và tiện ích bản đồ.",_template_label_indicator:"Chỉ báo",_template_description_indicator:"Chỉ báo cung cấp một bố cục nhiều trang với một tập hợp các tiện ích độc đáo được thiết kế để tạo ra một bảng điều khiển hiện đại.",_template_label_block1:"Khối 1",_template_label_block2:"Khối 2",_template_label_block3:"Khối 3",_template_label_block4:"Khối 4",_template_label_block5:"Khối 5",_template_label_block6:"Khối 6",_template_label_grid1:"Lưới 1",_template_label_grid2:"Lưới 2",_template_label_grid3:"Lưới 3",_template_label_grid4:"Lưới 4",_template_label_blankwindow:"Cửa sổ trống",_template_label_confirm:"Xác nhận",_template_label_alert:"Cảnh báo",_template_label_simple:"Đơn giản",_template_label_vogue:"Nổi bật",_template_label_novel:"Mới lạ",_template_label_sidebar:"Thanh bên",_template_label_tooltip:"Chú giải công cụ",_template_label_blank:"Màn hình trống",_template_label_centralfloating:"Nổi Ở giữa",_template_label_leftfloating:"Nổi Bên trái",_template_label_rightfloating:"Nổi Bên phải",_template_label_rightdock:"Đặt Bên phải",_template_label_leftdock:"Đặt Bên Trái",_template_label_stream:"Luồng",_template_label_guide:"Hướng dẫn",_template_label_slideshow:"Trình chiếu",_template_label_cascade:"Cascade",_template_label_showcase:"Trình diễn",_template_label_portfolio:"Danh mục",_template_label_flyer:"Tờ rơi",_template_label_vacation:"Kỳ nghỉ",_template_description_vacation:"Kỳ nghỉ là một biểu mẫu sử dụng tiện ích Trình điều khiển Bay và bản đồ để cung cấp một trang web tương tác về sự kiện chuyến đi.",_template_label_voyage:"Chuyến du hành",_template_description_voyage:"Chuyến du hành là một biểu mẫu gồm có các tuyến đường được lên kế hoạch tương tác của tiện ích Trình điều khiển Bay với dữ liệu bản đồ 3D, cùng với hình minh họa của các tiện ích Văn bản, Hình ảnh và Nút cho các điểm tham quan.",_template_label_carousel:"Ảnh trượt Xoay vòng",_template_label_particulars:"Thông tin chi tiết",_template_label_nopanel:"Không có Bảng điều khiển",_template_label_dashboard:"Bảng theo dõi thông tin",_template_description_dashboard:"Bảng điều khiển là biểu mẫu có bản đồ ở góc trên bên phải với năm trình giữ chỗ có thể tùy chỉnh ở xung quanh, cho phép bạn thiết kế nội dung một cách dễ dàng.",_template_label_seeker:"Trình tìm kiếm",_template_description_seeker:"Trình tìm kiếm là một biểu mẫu được thiết kế dưới dạng một trang chủ web. Bạn có thể sử dụng tiện ích tìm kiếm ở đầu trang để trích xuất thông tin mong muốn một cách nhanh chóng.",_template_label_booking:"Sách",_template_description_booking:"Biểu mẫu dạng sách cung cấp một bố cục nhiều trang với các tiện ích tìm kiếm và bộ lọc để lọc dữ liệu. Kết quả tìm kiếm được hiển thị trên một trang riêng, với một cửa sổ chi tiết hiển thị thêm thông tin.",_template_label_events:"Sự kiện",_template_description_events:"Sự kiện là một biểu mẫu cuộn sử dụng tiện ích Thẻ và tính năng di chuột để tạo hiệu ứng thu phóng khi di chuột.",_template_label_forecast:"Dự báo",_template_description_forecast:"Dự báo sử dụng các tiện ích thẻ, bản đồ và biểu đồ để trình bày một số thông tin quan trọng trong báo cáo, cùng với tiện ích vẽ cho phép người dùng cuối đánh dấu một số khu vực thú vị trên bản đồ.",_template_label_gear:"Bánh răng",_template_description_gear:"Bánh răng là một biểu mẫu chứa tiện ích Phân đoạn, có chức năng tự động phát thông qua bốn Chế độ xem với cấu trúc đồng nhất và phù hợp, nhằm hiển thị nội dung khác nhau trong cùng một danh mục.",_template_label_route:"Tuyến đường",_template_description_route:"Tuyến đường là một biểu mẫu sử dụng các tiện ích Biểu đồ, Danh sách và Đánh dấu phạm vi để giới thiệu hàng loạt các địa điểm, bao gồm cả tiện ích Chỉ đường để người dùng có thể hình dung được lộ trình đi đến những địa điểm này.",_template_label_steps:"Theo bước",_template_label_sketchbook:"Sổ phác thảo",_template_description_sketchbook:"Sổ phác thảo là một biểu mẫu cung cấp các tiện ích Thẻ, Bản đồ, Biểu đồ để trình bày dữ liệu và một tiện ích Vẽ để làm nổi bật những khu vực đáng quan tâm trên bản đồ.",_template_label_blankfullscreenGrid:"Lưới trống",_template_description_blankfullscreenGrid:"Một biểu mẫu trống để tạo thiết kế của riêng bạn trong trang lưới.",_template_label_blankfullscreengrid:"Lưới trống",_template_description_blankfullscreengrid:"Một biểu mẫu trống để tạo thiết kế của riêng bạn trong trang lưới.",_template_label_showplace:"Điểm tham quan",_template_description_showplace:"Điểm tham quan là một biểu mẫu với bốn Thẻ tiện ích có kích thước bằng nhau, cho phép hiển thị thêm thông tin chi tiết khi di chuột qua.",_template_label_kit:"Bộ kit",_template_description_kit:"Bộ kit là một biểu mẫu sử dụng tiện ích Bản đồ, Đánh dấu và Hộp công cụ 3D để hiển thị hiệu ứng 3D cho web scene.",_template_label_chronology:"Niên biểu",_template_description_chronology:"Niên biểu sử dụng tiện ích Dòng thời gian và Bản đồ để trực quan hoá mô hình dữ liệu thời gian và tiện ích In để in. Bên cạnh bản đồ, các loại biểu đồ khác nhau hiển thị thông tin thống kê cho khoảng thời gian thay đổi.",_template_label_checkerboard:"Bàn cờ",_template_description_checkerboard:"Bàn cờ là biểu mẫu trang dạng lưới với tiện ích bản đồ ở giữa và tiện ích liên quan đến bản đồ ở xung quanh.",_template_label_illustrator:"Minh họa",_template_description_illustrator:"Minh họa cho phép bạn mô tả toàn bộ một địa điểm trong bố cục nhiều trang với tiện ích Hình ảnh, Dòng thời gian và Bản đồ.",_template_label_showroom:"Phòng trưng bày",_template_description_showroom:"Phòng trưng bày là một biểu mẫu với bốn tiện ích Thẻ có kích thước bằng nhau, cho phép hiển thị thêm thông tin chi tiết khi di chuột qua.",_template_label_collage:"Collage",_template_description_collage:"Collage là biểu mẫu trang dạng lưới hiển thị nhiều tiện ích Hình ảnh xung quanh tiện ích Bảng cố định.",_template_label_pamphlet:"Pamphlet",_template_description_pamphlet:"Pamphlet là biểu mẫu dạng hiển thị nội dung đầy các trang và tập trung vào bản đồ. Tiện ích Thẻ hoạt động như một nội dung điều hướng với chế độ xem bảng điều khiển bên và Phần để mô phỏng hành động lật sách.",_template_label_avatarboard:"Avatarboard",_template_description_avatarboard:"Avatarboard là biểu mẫu trang dạng lưới hiển thị nhiều tiện ích Thẻ với hiệu ứng di chuột & lật qua, đồng thời cho phép bạn thêm các chi tiết khác ở phía sau như thẻ flash.",_template_label_mapflyer:"Mapflyer",_template_description_mapflyer:"Mapflyer là biểu mẫu trang dạng lưới sử dụng tiện ích Tọa độ với tiện ích Bản đồ để hiển thị văn bản tức thì và thông tin vị trí từ bản đồ.",_template_label_leaflet:"Leaflet",_template_description_leaflet:"Leaflet là biểu mẫu trang dạng lưới với các tiện ích Văn bản và tiện ích Hình ảnh bên trong nhiều tiện ích Cột, để bố cục được sắp xếp theo chiều dọc.",_template_label_index:"Chỉ số",_template_label_frame:"Khung hình",_template_description_frame:"Frame là biểu mẫu có thiết kế dạng khung mang lại cảm giác về ranh giới và cấu trúc. Bằng cách đặt hình ảnh và văn bản vào hộp, biểu mẫu sẽ giúp cho nội dung nhìn gọn gàng và dễ điều hướng hơn.",_template_label_multiverse:"Multiverse",_template_description_multiverse:"Multiverse là biểu mẫu được thiết kế để làm việc với nhiều nguồn dữ liệu khác nhau. Tiện ích Thêm Dữ liệu của biểu mẫu này làm đơn giản hóa quy trình thêm dữ liệu từ nhiều nguồn khác nhau, cho phép người dùng so sánh và phân tích nhiều nguồn dữ liệu thông qua bản đồ và bảng biểu.",_template_label_elevate:"Elevate",_template_description_elevate:"Elevate là biểu mẫu nhiều trang được tạo để nâng cao nội dung của bạn và mang tới cho người dùng những trải nghiệm khó quên. Thiết kế không phức tạp và cấu trúc dễ điều hướng biến biểu mẫu này trở thành lựa chọn kể chuyện xuất sắc.",_template_label_comparatist:"Comparatist",_template_description_comparatist:"Comparatist là biểu mẫu có tiện ích Trượt tương tác để so sánh các lớp bản đồ cạnh nhau. Các tiện ích Thông tin Biểu đồ và Đối tượng cũng cung cấp thông tin mô tả toàn diện hơn về dữ liệu cơ sở.",_template_label_panorama:"Panorama",_template_description_panorama:"Panorama có bản đồ trung tâm được bao quanh bởi các tiện ích Biểu đồ kép theo bố cục dạng lưới. Người dùng có thể tương tác với các tiện ích Biểu đồ, Danh sách và Bộ lọc để diễn giải dữ liệu được tạo bản đồ từ các góc nhìn khác nhau.",_template_label_lens:"Thấu kính",_template_description_lens:"Thấu kính là biểu mẫu dạng hai trang để khám phá dữ liệu đa chiều. Trang chủ mô tả thông tin thông qua các bản đồ, biểu đồ và các bộ lọc. Các phạm vi đánh dấu trên trang thứ hai cho phép người dùng kiểm tra các tập hợp con của dữ liệu cụ thể.",_template_label_datacollector:"Trình thu thập dữ liệu",_template_description_datacollector:"Trình thu thập dữ liệu là một biểu mẫu có tiện ích Chỉnh sửa với một bản đồ và cung cấp khả năng thêm, xóa và chỉnh sửa các đối tượng. Cùng với biểu đồ, văn bản và danh sách trong bảng điều khiển thu gọn bên trái, trình thu thập dữ liệu hiển thị các số liệu chính trong dữ liệu trực tiếp của bạn.",_template_label_tessellate:"Tessellate",_template_description_tessellate:"Tesselate là biểu mẫu trang cuộn giống bảng điều khiển, bao gồm văn bản, biểu đồ, bảng và nhiều tiện ích hiển thị thông tin từ một nguồn dữ liệu.",_template_label_plateau:"Plateau",_template_description_plateau:"Plateau là biểu mẫu ứng dụng hiện đại cơ bản gồm thanh công cụ phẳng và bộ chứa tiện ích ở đầu trang.",_template_label_preface:"Preface",_template_description_preface:"Preface là biểu mẫu toàn màn hình có màu nền chia tách. Biểu mẫu này hiển thị thông tin cơ bản qua các khối nhỏ gọn và phù hợp để giới thiệu.",_template_label_sleuth:"Sleuth",_template_description_sleuth:"Sleuth có menu điều hướng ở bên trái. Sử dụng phím mũi tên để chuyển đổi giữa các mục nội dung. Nhấp vào từng mục để hiển thị thông tin chi tiết của mục đó trong bảng điều khiển ở dưới cùng bên phải.",_template_label_footnote:"Ghi chú chân trang",_template_label_iteminfo:"Thông tin mục",_template_label_lrsviewer:"LRS Viewer",_template_description_lrsviewer:" LRS Viewer là biểu mẫu được thiết kế để truy vấn, tìm kiếm và thực hiện phân tích cơ bản trên dữ liệu LRS. Biểu mẫu này có Tìm kiếm theo Tuyến đường, Xác định LRS, Phân đoạn Động và các tiện ích khác. Tương thích với dữ liệu ArcGIS Roads and Highways và ArcGIS Pipeline Referencing.",_template_label_lrseditor:"LRS Event Editor",_template_description_lrseditor:"LRS Event Editor là biểu mẫu được thiết kế để chỉnh sửa và phân tích dữ liệu LRS. Biểu mẫu này có Thêm Điểm Sự kiện, Thêm Đường Sự kiện, Tách Sự kiện, Gộp sự kiện, Phân đoạn Động và các tiện ích khác. Tương thích với dữ liệu ArcGIS Roads and Highways và ArcGIS Pipeline Referencing.",_template_label_lrs_event_editor:"LRS Event Editor",_template_description_lrs_event_editor:"LRS Event Editor là biểu mẫu được thiết kế để chỉnh sửa dữ liệu LRS, bao gồm Thêm Sự kiện dạng Điểm, Thêm Sự kiện dạng Đường, Tách Sự kiện, Gộp sự kiện và các tiện ích khác. Tương thích với dữ liệu ArcGIS Roads and Highways và ArcGIS Pipeline Referencing.",_template_label_tab:"Tab",_template_description_tab:"Tab là một biểu mẫu tập trung vào bản đồ với các thẻ ở bên trái để mở nội dung thanh bên khác nhau.",_template_label_scrutiny:"Scrutiny",_template_description_scrutiny:"Biểu mẫu Scrutiny có banner lớn ở đầu trang, với các mô đun cuộn có cấu trúc tương tự phía dưới.",_template_label_assessor:"Assessor",_template_description_assessor:"Assessor cung cấp tổng quan súc tích qua ba thẻ tiêu biểu, tham chiếu được lập bản đồ và dữ liệu dạng bảng hỗ trợ.",_template_label_contour:"Contour",_template_description_contour:"Contour hỗ trợ kiểm tra bảng qua một chế độ xem bản đồ nổi bật được bổ sung bởi biểu đồ và văn bản theo bối cảnh phía dưới.",_template_label_logbook:"Logbook",_template_description_logbook:"Logbook là biểu mẫu nhiều trang cho phép khám phá dữ liệu đa chiều bằng cách ghi lại các thống kê chính trên trang chủ và tìm hiểu chi tiết các dữ liệu đó thông qua sử dụng các bản đồ, hình ảnh, biểu đồ và bảng trên các trang cuộn khác.",_template_label_recap:"Tóm gọn nội dung",_template_description_recap:"Tóm gọn nội dung có thiết kế gọn gàng và rõ ràng, tập trung chủ yếu vào nội dung. Hình ảnh và văn bản được sắp xếp thành khối và phân tách bằng khoảng trắng để phân chia chủ đề rõ ràng.",_template_label_skyline:"Đường chân trời",_template_description_skyline:"Đường chân trời là biểu mẫu đẹp mắt được thiết kế để giới thiệu dịch vụ chuyên nghiệp. Biểu mẫu gồm các phần riêng biệt có hình ảnh tròn, hiển thị bản đồ nổi bật và đánh dấu trang giống như thư viện ảnh.",_template_label_edifice:"Công trình lớn",_template_description_edifice:"Công trình lớn là biểu mẫu chuyên nghiệp để trực quan hóa kiến ​​trúc và quản lý tòa nhà.",_template_label_vista:"Toàn cảnh",_template_description_vista:"Toàn cảnh là biểu mẫu hai trang toàn diện được thiết kế để khám phá sâu về tòa nhà.",_template_label_booth:"Khung chụp",_template_description_booth:"Khung chụp sắp xếp nội dung thành một lưới các tiện ích thẻ, cung cấp chế độ xem chi tiết trong cửa sổ riêng để có trải nghiệm tìm hiểu tập trung.",_template_label_faq:"Câu hỏi thường gặp",_template_description_faq:"Câu hỏi thường gặp sử dụng tiện ích dạng xếp để sắp xếp các tiện ích văn bản, cho phép người dùng mở rộng một hoặc nhiều mục để duyệt tìm Câu hỏi thường gặp dễ dàng hoặc xem nội dung chi tiết.",_template_label_catalog:"Danh mục",_template_description_catalog:"Danh mục cung cấp bố cục rõ ràng có cột chính gồm các thẻ nội dung xếp chồng ở bên trái, cùng với khu vực mô tả cố định và nút điều hướng ở bên phải để duyệt tìm nội dung dễ dàng.",_template_label_prism:"Lăng kính",_template_description_prism:"Lăng kính cho phép bạn trình bày nội dung qua hai trang chi tiết được thiết kế tinh tế, đồng thời cung cấp các câu trả lời rõ ràng cho câu hỏi phổ biến trong bố cục Câu hỏi thường gặp để tăng tương tác người dùng.",_template_label_poster:"Áp phích",_template_tag_Web_page:"Trang web",_template_tag_Scrolling:"Đang cuộn",_template_tag_Map_centric:"Tập trung vào bản đồ",_template_tag_Map:"Bản đồ",_template_tag_Title:"Tiêu đề",_template_tag_Share:"Chia sẻ",_template_tag_Swip:"Vuốt",_template_tag_Basemap_Gallery:"Bộ sưu tập bản đồ nền",_template_tag_Chart:"Biểu đồ",_template_tag_Map_Layers:"Các lớp Bản đồ",_template_tag_Feature_Info:"Thông tin Đối tượng",_template_tag_Legend:"Chú giải",_template_tag_Section:"Phần",_template_tag_View:"Xem",_template_tag_Navigation:"Điều hướng",_template_tag_Pop_up:"Cửa sổ pop-up",_template_tag_Accordion:"Xếp",_template_tag_Divider:"Bộ chia",_template_tag_Blank:"Trống",_template_tag_Dashboard:"Bảng theo dõi thông tin",_template_tag_Logo:"Logo",_template_tag_Link:"Liên kết",_template_tag_Filter:"Bộ lọc",_template_tag_Card:"Thẻ",_template_tag_Query:"Truy vấn",_template_tag_Spatial_filter:"Bộ lọc không gian",_template_tag_Table:"Bảng",_template_tag_List:"Danh sách",_template_tag_Bookmark:"Đánh dấu phạm vi",_template_tag_Slides:"Trang chiếu",_template_tag_WAB_classic:"WAB cổ điển",_template_tag_Fullscreen:"Toàn màn hình",_template_tag_Search:"Tìm kiếm",_template_tag_Sidebar:"Thanh bên",_template_tag_Widget_Controller:"Trình điều khiển Tiện ích",_template_tag_Panel:"Bảng điều khiển",_template_tag_Direction:"Hướng",_template_tag_Route:"Tuyến đường",_template_tag_Draw:"Vẽ",_template_tag_Measurement:"Đo lường",_template_tag_Column:"Cột",_template_tag_Bar:"Thanh",_template_tag_Fly_Controller:"Trình điều khiển Bay",_template_tag_Route_fly:"Đường bay",_template_tag_Rotate_fly:"Xoay thao tác bay",_template_tag_Edit:"Chỉnh sửa",_template_tag_Fullscreen_grid:"Lưới toàn màn hình",_template_tag_Grid:"Lưới",_template_tag_Add_Data:"Thêm Dữ liệu",_template_tag_Coordinates:"Tọa độ",_template_tag_Add_to_map:"Thêm vào bản đồ",_template_tag_Building_Explorer:"Building Explorer",_template_tag_Select:"Chọn",_template_tag_Splash_window:"Cửa sổ splash",_template_tag_Website:"Trang web",_template_tag_Multipage:"Nhiều trang",_template_tag_Menu:"Menu",_template_tag_Screen_Group:"Nhóm Màn hình",_template_tag_Gallery:"Bộ sưu tập",_template_tag_Timeline:"Dòng thời gian",_template_tag_Print:"In",_template_tag_Window:"Cửa sổ",_template_tag_Banner:"Biểu ngữ",_template_tag_Survey:"Khảo sát",_template_tag_Pin:"Ghim",_template_tag_Embed:"Nhúng",_template_tag_Flow:"Dòng chảy",_template_tag_Indicator:"Chỉ báo",_template_tag_Auto_play:"Phát tự động",_template_label_beacon:"Beacon",_template_description_beacon:"Beacon là mẫu được thiết kế để gộp hình ảnh sống động với thông tin có cấu trúc. Mẫu này hỗ trợ hình ảnh lớn, điểm nổi bật chính và các phần văn bản rõ ràng để hướng dẫn người dùng tìm hiểu chủ đề hoặc khái niệm.",_template_label_harbor:"Harbor",_template_description_harbor:"Harbor là mẫu tập trung vào bản đồ có các nhóm bộ lọc có thể thu gọn theo bố cục dạng xếp. Người dùng có thể tương tác với bảng điều khiển bộ lọc động để tinh chỉnh dữ liệu hiển thị, còn các nút theo bối cảnh mở cửa sổ hoặc bảng điều khiển liên quan để cung cấp thêm thông tin chi tiết.",_template_tag_Swipe:"Thanh Trượt",_template_label_r3new1:"r3new1",_template_description_r3new1:"r3new1.",_template_label_compass:"La bàn",_template_description_compass:"La bàn là biểu mẫu lưới được sử dụng để sắp xếp dữ liệu với bản đồ, thông tin đối tượng và bảng điều khiển linh hoạt để hiển thị hình ảnh."})}}});